                    <div class="bg-indigo-700 font-semibold text-white py-2 px-4 rounded">
                      1
                    </div>
                  </div>
                )}
              </Draggable>
            </div>
          )}
        </Droppable>
      </DragDropContext>
    </div>
  );
}

export default App;
